import React from 'react'
//import Link from 'next/link'


const Footer = () => {
    return(
        <div class="md:flex bg-gray-800 text-white p-8 " >
           <p className="items-center" >&copy; Desenvolvido por <span><strong className="font-medium text-blue-500">Walter Baleco</strong></span></p>
        </div>
    )
}

export default Footer
